import React from "react";
import { withRouter } from "react-router-dom";

//UI
import {Dialog,DialogActions,DialogTitle,Button,Tooltip,Typography,AppBar,IconButton,
  CircularProgress,Avatar,ListItemText,ListItem,Drawer,Divider,Collapse} from '@material-ui/core';
// import Alert from '@material-ui/lab/Alert';
// import {Close,Share,FileCopyOutlined, Refresh} from '@material-ui/icons';
class Input extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
        productList : ["Airpod"]
    };
  }

  render() {
    const {productList} = this.state
    return(
        <div>
            <AppBar position="fixed" style = {{backgroundColor : "#333333"}}>
                <Typography>Purchase History</Typography>
            </AppBar>
            <div>
                {productList.map((p,i) => (
                    <Typography>{p}</Typography>
                ))}
            </div>
        </div> 
    )
  }
}
export default (Input);
